import json
import random

# 数据提取
data_file='../files/datas_test.json'
with open(data_file,'r',encoding='utf-8') as file:
    datas=json.load(file)

# 获取数据级中样本的id
def getSampleId(datas):
    data_id = []
    for sample in datas:
        sample_id=sample['id']
        if sample_id not in data_id:
            data_id.append(sample_id)
    # print(data_id)
    return data_id


#获取训练数据集使用的模型
def getModels(datas):
    models=[]
    for sample in datas:
        sample_model=sample['model']
        if sample_model not in models:
            models.append(sample_model)
        # print(models)
    return models

def getData_by_IdAndModel(datas,sample_id,model):
    for sample in datas:
        if sample['id']==sample_id and sample['model']==model:
            # print(111)
            return sample


def getMetric(datas,cascade_models,metric):
    data_id=getSampleId(datas)
    metrics=[]
    for sample_id in data_id:
        list=[]
        for model in cascade_models:
            sample=getData_by_IdAndModel(datas,sample_id,model)
            list.append(sample[metric])
        metrics.append(list)
    return metrics

def route_calculate(cost,delay,accuracy,rout,accuracy_threshold ):
    model_1=rout[0]
    model_2=rout[1]
    model_3=rout[2]
    metrics=[]
    for i in range(len(cost)):
        metric = []
        if accuracy[i][model_1]>=accuracy_threshold:
            metric.append(accuracy[i][model_1])
            metric.append(delay[i][model_1])
            metric.append(cost[i][model_1])
        elif accuracy[i][model_2]>=accuracy_threshold:
            metric.append(accuracy[i][model_2])
            delay_2=delay[i][model_1]+delay[i][model_2]
            metric.append(delay_2)
            cost_2=cost[i][model_1]+cost[i][model_2]
            metric.append(cost_2)
        else:
            metric.append(accuracy[i][model_3])
            delay_2 = delay[i][model_1] + delay[i][model_2]+delay[i][model_3]
            metric.append(delay_2)
            cost_2=cost[i][model_1]+cost[i][model_2]+cost[i][model_3]
            metric.append(cost_2)
        metrics.append(metric)
    return metrics


