# 定义评估指标权重系数
alpha = 1 # 准确率权重
beta = -1  # 时延权重
gamma = -1  # 花费权重

# 初始化非支配解集合
pareto_front = []


# 遍历每个数据样本
for sample_index in range(len(model_datas[0])):
# for sample_index in range(10):
    best_model = None

    # 计算当前样本的目标函数值
    sample_objective = []
    for model_index in range(len(model_datas)):
        model = model_datas[model_index][sample_index]
        accuracy = model[0]
        latency = model[1]
        cost = model[2]
        objective_value = alpha * accuracy + beta * latency + gamma * cost
        sample_objective.append((model_index, objective_value))

    # 比较当前样本的目标函数值与已有解
    # print(f"数据样本{sample_index}的sample_objective:{sample_objective}")
    dominated = False
    pareto_front_new = []
    for model_index, obj_value in sample_objective:
        model = model_datas[model_index][sample_index]
        if not pareto_front:  # 非支配解集合为空，添加当前解
            pareto_front.append((model_index, model))
        else:
            for pareto_model_index, pareto_model in pareto_front:
                pareto_obj_value = alpha * pareto_model[0] + beta * pareto_model[1] + gamma * pareto_model[2]
                if pareto_obj_value > obj_value:
                    dominated = True  # 当前解被支配
                    break
            if not dominated:
                pareto_front_new.append((model_index, model))
            dominated = False

    # 更新非支配解集合
    pareto_front = pareto_front_new

